script: |
  super -f text -I q5668.spq | sort > q5668.out

inputs:
  - name: q5668.spq
    data: |
      SELECT DISTINCT - - 88 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE + 40 + col0 / ( 70 ) NOT BETWEEN - col2 * - - ( - 69 ) AND NULL;
  - name: tab2

outputs:
  - name: q5668.out
    data: |
      88
